DROP DATABASE IF EXISTS hospital;
CREATE DATABASE hospital;
USE hospital;
DROP TABLE IF EXISTS Admins;
CREATE TABLE Admins (id INT(11) NOT NULL auto_increment PRIMARY KEY, firstname VARCHAR(50) NOT NULL default '',lastname VARCHAR(50) NOT NULL default '',username VARCHAR(50) NOT NULL default '',password VARCHAR(50) NOT NULL default '',email VARCHAR(50) NOT NULL default '',position VARCHAR(50) NOT NULL default '',telephone VARCHAR(50) NOT NULL default '');
DROP TABLE IF EXISTS Patients;
CREATE TABLE Patients (id INT(11) NOT NULL auto_increment PRIMARY KEY,name VARCHAR(50) NOT NULL default'',occupation VARCHAR(50) NOT NULL default '' ,email VARCHAR(50) NOT NULL default '',gender VARCHAR(50) NOT NULL default '',telephone VARCHAR(50) NOT NULL default '',symptoms VARCHAR(100) NOT NULL default '',blood VARCHAR(50) NOT NULL default '',address VARCHAR(100) NOT NULL default '',dob VARCHAR(50) NOT NULL default '',weight VARCHAR(50) NOT NULL default '',doctor_seen VARCHAR(50) NOT NULL default '',amount_paid VARCHAR(50) NOT NULL default '',app_date VARCHAR(50) NOT NULL default '');
DROP TABLE IF EXISTS Prescription;
CREATE TABLE Prescription (name VARCHAR(50) NOT NULL default '',email VARCHAR(50) NOT NULL default '',Prescription VARCHAR(100) NOT NULL default '');
DROP TABLE IF EXISTS equipments;
CREATE TABLE equipments (id int,name VARCHAR(50) NOT NULL default '',quantity VARCHAR(100) NOT NULL default '',AdminID int);
